import re
import copy
from PIL import Image, ImageDraw, ImageFont
import math
import base64
import io
import random

# Base64 encoded clock image (replace with your own encoded string)
CLOCK_IMAGE_BASE64 = """"""


def decode_base64_image(base64_string):
    """Decode a base64 string into a PIL image."""
    image_data = base64.b64decode(base64_string)
    return Image.open(io.BytesIO(image_data))


def draw_hand(draw, center, length, angle, color, width):
    """Draw a hand on the clock."""
    angle_rad = math.radians(angle)
    end_x = center[0] + length * math.cos(angle_rad)
    end_y = center[1] + length * math.sin(angle_rad)
    draw.line([center, (end_x, end_y)], fill=color, width=width)


def get_image_data(data=None):
    """Generate an image of a clock showing the given time."""
    if data is None:
        data = {}
    hours = random.randint(1, 12)
    minutes = random.randint(0, 11) * 5
    width, height = 854, 480
    center = (width // 2, height // 2)

    # Create image
    image1 = Image.new("RGB", (width, height), "white")
    draw1 = ImageDraw.Draw(image1)

    # Load clock background image from base64
    clock_image = decode_base64_image(CLOCK_IMAGE_BASE64).convert("RGB")
    aspect_ratio = clock_image.width / clock_image.height
    new_width = int(width * 0.45)
    new_height = int(new_width / aspect_ratio)
    clock_image = clock_image.resize((new_width, new_height))
    image1.paste(clock_image, ((width - clock_image.width) // 2, (height - clock_image.height) // 2))

    # Calculate angles for hands
    hour_angle = (360 * (hours % 12) / 12) + (30 * (minutes / 60)) - 90
    minute_angle = 360 * minutes / 60 - 90

    # Draw hands
    clock_radius = min(width, height) // 3
    draw_hand(draw1, center, clock_radius * 0.55, hour_angle, "red", 5)  # Red hour hand
    draw_hand(draw1, center, clock_radius * 0.85, minute_angle, "green", 3)  # Green minute hand

    # Draw center point
    draw1.ellipse([
        (center[0] - 5, center[1] - 5),
        (center[0] + 5, center[1] + 5)
    ], fill="black")

    font_size = 70
    try:
        font = ImageFont.truetype("arial.ttf", font_size)  # Use Arial font
    except IOError:
        font = ImageFont.load_default()  # Fallback if Arial is unavailable

    image2 = copy.deepcopy(image1)
    draw2 = ImageDraw.Draw(image2)
    draw2.text((20, 20), f"{hours}:{minutes:02d}", fill=(0, 0, 0), font=font)

    answer = re.compile(f"^(0?{hours} *: *0?{minutes}|0?{hours}(h|heurs?) *0?{minutes}(mn|min|minutes?)?)")
    return image1, image2, [], [], answer, f"{hours}:{minutes:02d}"
